import React, { Component } from 'react'

class fontSize extends Component {
    state={
        Fontsize:null
    }

    handleChange=(e)=>{
        this.setState({
            ...this.state,
            textFont:e.target.value
        });
      }

    render(){
        console.log(this.state.textFont)

        return (
            <div className="mt-2 ml-2">
                <select id="input-fontsize" value={this.state.selected}  onChange={this.handleChange}>
                    <option value="5">5px</option>      
                    <option value="10">8px</option>
                    <option value="20">10px</option>
                    <option value="40">12px</option>
                    <option value="50">14px</option>
                    <option value="60">16px</option>
                    <option value="70">18px</option>
                    <option value="80">20px</option>
                    <option value="90">22px</option>
                    <option value="100">25px</option>
                </select>


            </div>
        )
    }
}
export default fontSize
